import "./ExpenseForm.css";

const ExpenseForm = () => {
  return (
    <div className="new-expense__controls">
        <div className="new-expense__control label new-expense__control input">
          <label > Title</label>
          <input  type="text" />
        </div>
        <div className="new-expense__control label new-expense__control input">
          <label>Amount</label>
          <input type="text" />
        </div>
        <div className="new-expense__control label new-expense__control input">
          <label >Date</label>
          <input  type="date" />
        </div>
    </div>
  );
};

export default ExpenseForm;
